import React, { useState, Suspense } from "react"
import ReactDOM from "react-dom"
import {
  BrowserRouter as Router,
  Routes,
  Route,
  useOutletContext,
} from "react-router-dom"
import * as serviceWorker from "./serviceWorker"
import "mdb-react-ui-kit/dist/css/mdb.min.css"
import "@fortawesome/fontawesome-free/css/all.min.css"
import "./index.css"
import "./libs/css/Animate.min.css"
import "./libs/css/gradientBg.css"

const Manager = React.lazy(() => import("./App"))
const Widget = React.lazy(() => import("./Widget"))
const Game = React.lazy(() => import("./Game"))

window.wait = async (t = 1) => {
  return new Promise((resolve) => setTimeout(() => resolve, t * 1000))
}

window.imageUrlFixing = (url = "") => {
  return url.replace("p16-sign-va.tiktokcdn.com", "p16-va.tiktokcdn.com")
}

window.randomInt = (min = 10, max = 99) =>
  Math.floor(Math.random() * (max - min + 1) + min)

const Index = (props) => {
  return <h5>Home page</h5>
}

const Main = () => {
  return (
    <>
      <Router>
        <Routes>
          <Route index element={<Index />} />
          <Route
            path="/games"
            element={
              <>
                <Suspense fallback={<div>Loading</div>}>
                  <Manager />
                </Suspense>
              </>
            }
          >
            <Route
              path="wheel-of-fortune"
              element={
                <Suspense fallback={<div>Loading</div>}>
                  <Game />
                </Suspense>
              }
            />
            <div id="gradient_bg"></div>
          </Route>
          <Route
            path="widget"
            element={
              <Suspense fallback={<div>Loading</div>}>
                <Widget />
              </Suspense>
            }
          />
          <Route
            path="*"
            element={
              <div className="text-center">
                <h5>ERROR! Page not found</h5>
              </div>
            }
          />
        </Routes>
      </Router>
    </>
  )
}

ReactDOM.render(<Main />, document.getElementById("root"))

serviceWorker.unregister()
